script: |
  super -f text -I q11690.spq | sort > q11690.out

inputs:
  - name: q11690.spq
    data: |
      SELECT DISTINCT col1 * + CAST ( - + CAST ( + - col0 AS INTEGER ) AS REAL ) + - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 <> 34 + + + col1 * + + 48 * + col0 + - 63;
  - name: tab1

outputs:
  - name: q11690.out
    data: |
